app = Flask(__name__)


def run_ocr(base64_string):
    # 假设你有一个Base64编码的字符串
    # base64_string = ""  # 这是"Hello World"的Base64编码
    # 使用b64decode函数将其解码为二进制数据（字节串）
    print(f'base64_string: {base64_string}')
    # st_time = time.time()
    binary_img = base64.b64decode(base64_string)
    # en_time = time.time()
    # print(en_time-st_time)
    # 输出结果
    # print(binary_img)
    engine = RapidOCR()
    result, elapse_list = engine(binary_img)
    # print('result', result)
    res_list = []
    for line in result:
        res = line[1]
        res_list.append(res)
    # print('res_list', res_list)
    # print(f'res_list: {res_list}')
    return res_list


# =======================================莱芜工厂 start=======================================================
def get_double_axle_param_laiwu(res_list):
    # 车辆识别号
    vin = res_list[res_list.index('Vin') + 1]
    # 类型
    vtype = res_list[res_list.index('类型：') + 1]
    # 车桥偏移
    S = res_list[res_list.index('方向盘水平仪') + 1].split('[')[0]
    # 一桥前束和
    T1 = res_list[res_list.index('前束和') + 1].split('[')[0]
    # 二桥前束和
    first_position = res_list.index('前束和')
    second_position = res_list.index('前束和', first_position + 1)
    T2 = res_list[second_position + 1].split('[')[0]
    # 一桥平行度
    P13 = res_list[res_list.index('平行度') + 1].split('[')[0]
    # 相对一桥平行度
    first_position = res_list.index('平行度')
    second_position = res_list.index('平行度', first_position + 1)
    P12 = res_list[second_position + 1].split('[')[0]
    axle_param = {'axle_type': '双桥', 'vin': vin, 'vtype': vtype, 'S': S, 'T1': T1, 'T2': T2, 'P13': P13, 'P12': P12}
    return axle_param


def get_single_axle_param_laiwu(res_list):
    # 车辆识别号
    vin = res_list[res_list.index('Vin') + 1]
    # 类型
    vtype = res_list[res_list.index('类型：') + 1]
    # 车桥偏移
    S = res_list[res_list.index('方向盘水平仪') + 1].split('[')[0]
    # 一桥前束和
    T1 = res_list[res_list.index('前束和') + 1].split('[')[0]
    # 一桥平行度
    P13 = res_list[res_list.index('行驶角') + 1].split('[')[0]
    axle_param = {'axle_type': '单桥', 'vin': vin, 'vtype': vtype, 'S': S, 'T1': T1, 'P13': P13}
    return axle_param


def get_result_laiwu(res_list):
    # 双桥
    if 'F1,F2轴' in res_list:
        axle_param = get_double_axle_param_laiwu(res_list)
    # 单桥
    else:
        axle_param = get_single_axle_param_laiwu(res_list)

    print(f'axle_param: {axle_param}')
    return axle_param


# =======================================莱芜工厂 end=======================================================
@app.route("/hello", methods=["post"])
def hello():
    print('hello')
    return json.dumps('hello ok')


@app.route("/", methods=["post", "get"])
def run():
    #
    # 输入两个参数，工厂和base64图片
    params = request.get_json()
    # print(params)
    # {'factory': 'laiwu', 'base64_string': 'iVBORw0KGgoAAAANSUhEUgAABAAAAAMACAYAAAC6uhUNAAAAAXNSR0IArs4c6QAA'}
    factory = params['factory']
    base64_string = params['base64_string']
    print(f'factory: {factory}')
    # print(f'base64_string: {base64_string}')

    try:
        start_t = time.time()
        res_list = run_ocr(base64_string)
        axle_param = get_result_laiwu(res_list)
        end_t = time.time()
        print('响应时间', end_t - start_t)

    except Exception as e:
        print(e)
        axle_param = {}

    return json.dumps(axle_param)


if __name__ == '__main__':
    app.run(debug=True, host="0.0.0.0", port=5050)
